script: |
  super -f text -I q10825.spq | sort > q10825.out

inputs:
  - name: q10825.spq
    data: |
      SELECT DISTINCT - + cor0.col0 + cor0.col2 / - ( + cor0.col0 * + cor0.col0 ) FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q10825.out
    data: |
      -64
      -80
      -9
